    } var findOrder = function(numCourses, prerequisites) {
    // 记录后序遍历结果
    let postorder = [];
    // 记录是否存在环
    let hasCycle = false;
    let visited = new Array(numCourses);
    let onPath = new Array(numCourses);

    let graph = buildGraph(numCourses, prerequisites);

    let traverse = function(graph, s) {
        if (onPath[s]) {
            // 发现环
            hasCycle = true;
        }
        if (visited[s] || hasCycle) {
            return;
        }
        // 前序遍历位置
        // @visualize color *graph._v(s) #7ed67e
        visited[s] = true;
        // @visualize color *graph._v(s) #e77427
        onPath[s] = true;
        for (let t of graph.neighbors(s)) {
            // @visualize color *graph._e(s,t) #e77427
            traverse(graph, t);
            // @visualize color *graph._e(s,t) #unset
        }
        // 后序遍历位置
        // @visualize color *graph._v(s) #7ed67e
        postorder.push(s);
        onPath[s] = false;
    }

    for (let i = 0; i < numCourses; i++) {
        // 遍历图
        traverse(graph, i);

        // 有环图无法进行拓扑排序
        if (hasCycle) {
            return [];
        }
    }

    // 逆后序遍历结果即为拓扑排序结果
    postorder.reverse();
    return postorder;
}


// 建图函数
function buildGraph(numCourses, prerequisites) {
    // 图中共有 numCourses 个节点
    // @visualize skip
    const adjList = Array.from({ length: numCourses }, () => []);
    for (const edge of prerequisites) {
        const from = edge[1], to = edge[0];
        // 修完课程 from 才能修课程 to
        // 在图中添加一条从 from 指向 to 的有向边
        adjList[from].push(to);
    }
    return Graph.createDirectedGraphFromAdjList(adjList);
}

